%jdbc(hive)
drop table if exists mortinie.sbb;
create external table mortinie.sbb(TripDate string, TripID string, OperatorID string, OperatorABK string, OperatorName string, TransportType string, LineID string, LineText string, CirculationID string, ServiceType string, IsAdditionalTrip boolean, IsCancelledTrip boolean, StopBPUIC bigint, StopName string, ArrivalTime string, ActualArrivalTime string, ArrivalTimeStatus string, DepartureTime string, ActualDepartureTime string, DepartureTimeStatus string, DoNotStop boolean)
    row format delimited fields terminated by ';'
    stored as textfile
    location '/datasets/sbb'
    tblproperties ("skip.header.line.count"="1");

select * from mortinie.sbb limit 5;

%jdbc(hive)
select count(distinct trip_id, transport_type)
from mortinie.sbb_travel_delay;
